    false,nt"url": null,nt"notes": "This Narrative Report for Malheur National
    Wildlife Refuge covers September through December of 1956.  The report begins with
    general information about the refugeu2019s weather and water conditions for the
    year, as well as fires.  Wildlife is discussed in the following section.  Animals
    of interest include migratory birds, upland game birds, big game animals, fur animals,
    predators, rodents, hawks, eagles, and fish.  Refuge maintenance and development
    activities are covered, including physical developments, plantings, and collections.
     Economic uses of the refuge are also discussed; the primary source is grazing.
     A progress report on field investigations and research is provided.  Public relations
    are covered; topics include recreational use of the refuge, visitors, hunting, and
    fishing.  Additionally, items of interest and pictures are provided.",nt"license_title":
